  `goods_attr` text,
  PRIMARY KEY (`rec_id`),
  KEY `back_id` (`back_id`),
  KEY `goods_id` (`goods_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `hhs_back_order`;
CREATE TABLE `hhs_back_order` (
  `back_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
