  `user_id` int(10) unsigned NOT NULL DEFAULT '0',
  `order_id` int(10) DEFAULT '0',
  PRIMARY KEY (`comment_id`),
  KEY `parent_id` (`parent_id`),
  KEY `id_value` (`id_value`),
  KEY `order_id` (`order_id`)
